import React, { Component } from 'react'
export default class AboutUs extends Component {
    render(){
        return(
            <div>
                <h1>Hi I 'm Shivani </h1>
                <img src="me.jpeg" alt="Shivani"></img>
                <p>I am doing Masters in Computing and data analytics from Saint Mary Halifax </p>
                <p>I joined MCDA because I want to be a data scientist.</p>

                </div>

        )
    }




}
